import React, { useState } from 'react';
import axios from 'axios';
import './MigrationForm.css'; 
import { Link } from 'react-router-dom';


const MigrationForm = () => {
  const [formData, setFormData] = useState({
    projectName: '',
    awsAccessKey: '',
    awsSecretKey: '',
    region: '',
    sshUser: '',
    sshPassword: '',
    sshPort: '',
    sshIpAddress: '',
    sshKeyFile: '',
    sshKeyFilePath: '',
    authMethod: 'password', 
  });

  const handleChange = (e) => {
    if (e.target.name === 'authMethod') {
     
      setFormData({ ...formData, authMethod: e.target.value, sshPassword: '', sshKeyFile: null });
    } else {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    }
  };

  const handleFileChange = (e) => {
    const filePath = e.target.files[0] ? e.target.files[0].name : ''; // Extract the file path
    setFormData({ 
      ...formData, 
      sshKeyFile: e.target.files[0], // Store the file in the form data
      sshKeyFilePath: filePath // Store the file path in the form data
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formDataToSend = new FormData();
    formDataToSend.append('projectName', formData.projectName);
    formDataToSend.append('awsAccessKey', formData.awsAccessKey);
    formDataToSend.append('awsSecretKey', formData.awsSecretKey);
    formDataToSend.append('region', formData.region);
    formDataToSend.append('sshUser', formData.sshUser);
    formDataToSend.append('sshPassword', formData.sshPassword);
    formDataToSend.append('sshPort', formData.sshPort);
    formDataToSend.append('sshIpAddress', formData.sshIpAddress);
    formDataToSend.append('sshKeyFile', formData.sshKeyFile);
    formDataToSend.append('sshKeyFilePath',formData.sshKeyFilePath);

    console.log(formData);

    const instance = axios.create({
      baseURL: 'http://localhost:8000', 
    });
    

    instance.post('/api/migrationForm', formDataToSend)
      .then(response => {
        console.log('Response:', response.data);
        alert('Form submitted successfully!');
      })
      .catch(error => {
        console.error('Error:', error);
        alert('Error submitting form. Please try again.');
      });
  };

  return (
    <div className="container">
      <h2>AWS Migration Validation Form</h2>
      <form onSubmit={handleSubmit}>
      <label>Project Name: </label>
        <input type='text' name='projectName' value={formData.projectName} onChange={handleChange} />
        <br />
        <label>AWS Secret Key : </label>
        <input type='text' name='awsSecretKey' value={formData.awsSecretKey} onChange={handleChange} />
        <br />
        <label>AWS Access Key : </label>
        <input type='text' name='awsAccessKey' value={formData.awsAccessKey} onChange={handleChange} />
        <br />
        <label>Region : </label>
        <input type='text' name='region' value={formData.region} onChange={handleChange} />
        <br />
        <label>SSH User:</label>
        <input type="text" name="sshUser" value={formData.sshUser} onChange={handleChange} />
        <br />

        <label>Authentication Method:</label>
        <div>
          <input
            type="radio"
            id="password"
            name="authMethod"
            value="password"
            checked={formData.authMethod === 'password'}
            onChange={handleChange}
          />
          <label htmlFor="password">Password</label>
          <input
            type="radio"
            id="keyFile"
            name="authMethod"
            value="keyFile"
            checked={formData.authMethod === 'keyFile'}
            onChange={handleChange}
          />
          <label htmlFor="keyFile">Key File</label>
        </div>
        <br />
        {formData.authMethod === 'password' ? (
          <>
            <label>Password:</label>
            <input type="password" name="sshPassword" value={formData.sshPassword} onChange={handleChange} />
          </>
        ) : (
          <>
            <label>SSH Key File:</label>
            <input type="file" name="sshKeyFile" onChange={handleFileChange} />
          </>
        )}
        <br />
        <label>SSH Port:</label>
        <input type="number" name="sshPort" value={formData.sshPort} onChange={handleChange} />
        <br />
        <label>SSH IP Address:</label>
        <input type="text" name="sshIpAddress" value={formData.sshIpAddress} onChange={handleChange} />
        <br />
        
        <button type="submit">Submit</button>
        
        
      </form>
      <Link to="/ssh"><button>Fetch SSH Data</button></Link>
    </div>
  );
};

export default MigrationForm;
